import numpy as np
from scipy import signal
from scipy import interpolate

SAMPLING_RATE = 100e6
IMP_RATE = 125e6

def main_function():
    set_two = True
    SIG_INDEX = 2
    print("SIG_INDEX: ", SIG_INDEX)
    if set_two:
        input_data = io.get_set_two()
    else:
        input_data = io.get_set_one()
    sig = input_data[SIG_INDEX] # signal
    print("full length (as IQ pairs)", len(sig)//2)

    imp = get_imp()
    equalized = sig

def get_imp(short=True):
    if short:
        imp = short_imp
    else:
        imp = long_imp
    imp = imp.split('\n')
    imp = [x.strip().split(';') for x in imp if ';' in x]
    imp = [float(x[0]) + 1j*float(x[1]) for x in imp]
    impI = np.real(imp)
    impQ = np.imag(imp)
    return impI, impQ

def upsample(Isig, Qsig): # can do downsampling too
    upsample_factor = SAMPLING_RATE/IMP_RATE
    LEN = len(Isig)
    assert (len(Qsig) == LEN)
    interp_Isig = interpolate.interp1d(range(LEN), Isig)
    interp_Qsig = interpolate.interp1d(range(LEN), Qsig)
    up_times = np.arange(0, LEN - 1, 1/upsample_factor)
    print(up_times, LEN)
    up_Isig = interp_Isig(up_times)
    up_Qsig = interp_Qsig(up_times)
    return up_Isig, up_Qsig


